import Image from './logo.svg';
import Image1 from './benz.jpg';
import Image2 from './info1.svg';
import './header.css';

function logo () {

        return (
        <div className="header">
            <div className="logo">
                <img src={Image} className="IMAGE" alt="benze logo" />
                <img src={Image1} className="IMAGE1"alt="benze" />
            </div>


        <div className="nav">
            <div className="upperbar">
                <img src={Image2} className="Image2" alt="i symbol"></img>
                <ul type="none">
                    <li>Provider/Privacy Statement</li>
                    <li>Deutsch</li>
                </ul>
                <div className="lowerbar">

                </div>
            </div>
        </div>
        </div>
        );
}
export default logo;
